import { useEffect, useState } from "react";

export default function Todo({ todos }) {
  return (
    <div>
      {setTodos(
        todos.map((todo) => (
          <ul key={todos.id}>
            <li>{todo.userId}</li>
            <li>{todo.title}</li>
            <li>{todo.completed}</li>
          </ul>
        ))
      )}
    </div>
  );
}
